    "# Bikeshare Case Study\n",
    "\n",
    "***Introduction***\n",
    "\n",
    "Cyclistic's bike-share program debuted in 2016. Since then, 5,824 geotracked bikes have been added to 692 stations around Chicago. Unlocked bikes may be returned to any system station.\\nCyclistic's marketing approach formerly focused on wide consumer appeal. Single-ride passes, full-day tickets, and yearly memberships helped make this possible. Casual cyclists buy single-ride or full-day passes. Cyclistic members buy yearly memberships.\n",
    "\n",
    "Annual members are more lucrative than casual cyclists, say Cyclistic's experts. Moreno thinks raising the number of yearly members will be crucial to future success. Moreno thinks he can turn casual riders into members without targeting new consumers. She says casual bikers know about Cyclistic and use it for mobility.\n",
    "\n",
    "Moreno is focused. Convert casual riders into yearly members via marketing. The marketing analyst team must understand how yearly members and casual riders vary, why casual riders would acquire a membership, and how digital media may alter their marketing methods. Moreno and her colleagues want to analyze Cyclistic bike ride data for patterns.\n",
    "\n",
    "***Objectives***\n",
    "\n",
    "The objective is  to comprehend how casual riders and yearly members use Cyclistic bikes differently. Your team will build a new marketing plan based on these findings to convert casual riders into members."
   ]
  },
