    "## ASK\n",
    "The project seeks to examine the data acquired in order to get insights from the number of trips taken, ride length, and the activity of various user types. We are to offer recommendations for developing a company plan based on the findings.\n",
    "\n",
    "\n",
    "## PREPARE\n",
    "\n",
    "**Data**\n",
    "\n",
    "The data has been made available by Motivate International Inc.Under this [license](http://www.divvybikes.com/data-license-agreement). The following are the available variables\n",
    "ride_id: \n",
    "unique id of a single trip (string)\n",
    "rideable_type: type of bike used (string)\n",
    "started_at: date and time the bike was undocked (datetime)\n",
    "ended_at: date and time the bike was docked (datetime)\n",
    "start_station_name: location of start docking station (string)\n",
    "start_station_id: id of start docking station (string)\n",
    "end_station_name: location of end docking station (string)\n",
    "end_station_id: id of end docking station (string)\n",
    "start_lat: start docking station latitude (numeric)\n",
    "start_lng: start docking station longitude (numeric)\n",
    "end_lat: end docking station latitude (numeric)\n",
    "end_lng: end docking station longitude (numeric)\n",
    "member_casual: rider type (string)\n",
    "The data is available [here](http://divvy-tripdata.s3.amazonaws.com/index.html)\n",
    "\n",
    "## PROCESS\n",
    "\n",
    "will be used since it can manage huge volumes of data. In addition, data may be easily cleaned and presented, which facilitates analysis. The data were obtained in zip file and then transformed to csv before being uploaded to R. The documents were filed for further examination.\\nThe data is given in a tabular manner with consistent column names. In addition, numerous column names were altered since they were ambiguous. For the tenth and eleventh months of 2020, the data type in the start station id and finish station id columns is inconsistent; the data appears as an integer but is really a character. Consequently, the data type is updated to address the problem. Additionally, the data type of the began at and concluded at columns is inconsistent; rather than date time, the data type seems to be character. The data are thus transformed to date-time format. The usage of R Markdown for documentation and reporting.\n"
   ]
  },
